import React from "react";
import {Box, Typography, Button, Card, CardMedia, CardContent, CardActions, Chip} from '@material-ui/core';
import { LocationOnOutlined } from "@material-ui/icons";
import { PhoneRounded } from "@material-ui/icons";
import { Rating } from "@material-ui/lab";

import useStyles from './styles';

const PlaceDetails = ({place}) =>{
    const classes = useStyles();

    return(
       <Card elevation={6}>
           <CardMedia style={{height: 350}}
                        image={place.photo? place.photo.images.large.url : 'https://www.foodserviceandhospitality.com/wp-content/uploads/2016/09/Restaurant-Placeholder-001.jpg'}
                        title={place.name} />
            <CardContent>
                <Typography gutterBottom variant="h5">{place.name}</Typography>
                <Box display="flex" justifyContent="space-between">
                    <Typography variant="subtitle">Price</Typography>
                    <Typography gutterBottom variant="subtitle">{place.price_level}</Typography>
                </Box>
                <Box display="flex" justifyContent="space-between">
                    <Typography variant="subtitle">Ranking</Typography>
                    <Typography gutterBottom variant="subtitle">{place.ranking}</Typography>
                </Box>
                {place?.awards?.map((award)=> (
                    <Box my={1} display="flex" justifyContent="space-between" alignItems="center">
                        <img src={award.images.small} alt={award.display_name} />
                        <Typography variant="subtitle" color="textSecondary">{award.display_name}</Typography>
                    </Box>
                ))}
                {place?.cuisine?.map(( {name} )=>(
                    <Chip key={name} size="small" label={name} className={classes.chip} />
                ))}
                {places?.address && (
                    <Typography gutterBottom variant="body" color="textSecondary" className={classes.subtitle}>
                        <LocationOnOutlined /> {place.address}
                    </Typography>
                )}
            </CardContent>
       </Card>
    )
}

export default PlaceDetails;
